// Get the uploaded file from the form submission
// In form trigger, binary data is accessible through $input.first().binary
const binaryData = $('Convert to Binary').first().binary;
const jsonData = $('Convert to Binary').first().json;

// Check if binary data exists
if (!binaryData || !binaryData['data']) {
  throw new Error('No PDF file found in the binary data. Available keys: ' + Object.keys(binaryData || {}));
}

const pdfFile = binaryData['data'];

// Extract file information
const fileName = pdfFile.fileName || 'uploaded.pdf';
const mimeType = pdfFile.mimeType || 'application/pdf';
const fileSize = pdfFile.fileSize || 0;

// Log for debugging
console.log('PDF File Info:', {
  fileName: fileName,
  mimeType: mimeType,
  fileSize: fileSize,
  hasData: !!pdfFile.data
});

// Return the processed data with proper binary structure
return {
  json: {
    fileName: fileName,
    mimeType: mimeType,
    fileSize: fileSize,
    uploadTimestamp: new Date().toISOString(),
    status: 'PDF parsed successfully'
  },
  binary: {
    data: pdfFile  // Pass the entire file object with data, mimeType, etc.
  }
};

// Parse the OCR output and convert to spreadsheet format
const input = $input.first().json.pages;

// Initialize arrays to store parsed data
let allTransactions = [];
let documentInfo = {};

// Extract document info from the first document's first page
if (input && input.length > 0) {
  const firstPage = input[0].markdown;

  // Extract basic document info
  documentInfo = {
    form_type: "SPT TAHUNAN PAJAK PENGHASILAN WAJIB PAJAK BADAN",
    lampiran: "LAMPIRAN - III 1771 -III", 
    npwp: "01.759.187.6-431.000",
    company_name: "PT MEGASARI MAKMUR",
    period: "04/20 s.d 03/21",
    year: "2020"
  };
}

// Function to clean and parse monetary values
function parseAmount(value) {
  if (!value || value === '0') return 0;
  // Remove dots, spaces, and convert to number - handle formats like "5.527 .000"
  const cleaned = value.toString().replace(/\s/g, '').replace(/\./g, '');
  return parseInt(cleaned) || 0;
}

// Function to parse date
function parseDate(dateStr) {
  if (!dateStr) return '';
  // Handle dates like "03/04/2020"
  const match = dateStr.match(/(\d{2})\/(\d{2})\/(\d{4})/);
  return match ? `${match[1]}/${match[2]}/${match[3]}` : dateStr;
}

// Process each document and page
for (const document of input) {
  if (!document) continue;

  for (const page of input) {
    const markdown = page.markdown;

    // Split by lines and process each line
    const lines = markdown.split('\n');

    for (const line of lines) {
      const trimmedLine = line.trim();

      // Skip non-data rows
      if (!trimmedLine || 
          trimmedLine.startsWith('| ---') ||
          trimmedLine.includes('NAMA') ||
          trimmedLine.includes('NPWP') ||
          trimmedLine.includes('(1)') ||
          trimmedLine.includes('NO |') ||
          trimmedLine.includes('JUMLAH') ||
          trimmedLine.includes('Catatan')) {
        continue;
      }

      // Look for rows that start with a number
      const numberMatch = trimmedLine.match(/^\|\s*(\d+)\s*\|/);
      if (numberMatch) {
        const rowNumber = parseInt(numberMatch[1]);

        // Split the line by | and clean up
        const cells = trimmedLine.split('|').map(cell => cell.trim()).filter(cell => cell !== '');

        if (cells.length >= 6) {
          let transactionData;

          if (cells.length >= 8) {
            // 8-column format: NO | NAMA | NPWP | JENIS | RUPIAH | TAX | NOMOR | TANGGAL
            transactionData = {
              no: rowNumber,
              company_name: cells[1] || '',
              npwp: cells[2] || '',
              transaction_type: cells[3] || '',
              transaction_value_rupiah: parseAmount(cells[4]),
              tax_withheld_rupiah: parseAmount(cells[5]),
              document_number: cells[6] || '',
              date: parseDate(cells[7])
            };
          } else if (cells.length === 6) {
            // 6-column format: NO | NAMA | NPWP | JENIS | RUPIAH | TAX
            transactionData = {
              no: rowNumber,
              company_name: cells[1] || '',
              npwp: cells[2] || '',
              transaction_type: cells[3] || '',
              transaction_value_rupiah: parseAmount(cells[4]),
              tax_withheld_rupiah: parseAmount(cells[5]),
              document_number: '',
              date: ''
            };
          }

          // Only add valid transactions
          if (transactionData && transactionData.no > 0 && transactionData.no <= 106) {
            allTransactions.push(transactionData);
          }
        }
      }
    }
  }
}

// Remove duplicates and sort by number
const uniqueTransactions = allTransactions.filter((transaction, index, self) => 
  index === self.findIndex(t => t.no === transaction.no)
);

uniqueTransactions.sort((a, b) => a.no - b.no);

// Calculate summary
const totalTaxAmount = uniqueTransactions.reduce((sum, trans) => sum + trans.tax_withheld_rupiah, 0);

const summary = {
  total_transactions: uniqueTransactions.length,
  total_tax_amount: totalTaxAmount,
  currency: "IDR"
};

// Create CSV content
const csvHeaders = [
  'No',
  'Company Name',
  'NPWP', 
  'Transaction Type',
  'Transaction Value (IDR)',
  'Tax Withheld (IDR)',
  'Document Number',
  'Date'
];

let csvContent = csvHeaders.join(',') + '\n';

for (const transaction of uniqueTransactions) {
  const row = [
    transaction.no,
    `"${transaction.company_name}"`,
    transaction.npwp,
    `"${transaction.transaction_type}"`,
    transaction.transaction_value_rupiah,
    transaction.tax_withheld_rupiah,
    transaction.document_number,
    transaction.date
  ];
  csvContent += row.join(',') + '\n';
}

// Add summary
csvContent += `\nSUMMARY,,,,,${totalTaxAmount},,\n`;
csvContent += `Total Transactions: ${uniqueTransactions.length},,,,,,,\n`;

console.log(`Processed ${uniqueTransactions.length} transactions`);
console.log(`Total tax amount: ${totalTaxAmount.toLocaleString()} IDR`);

// Return structured data
return {
  json: {
    document_info: documentInfo,
    transactions: uniqueTransactions,
    summary: summary,
    data:input.length,
    processing_status: 'Success',
    csv_ready: true
  }
};

