const items = [];
const webhookData = $input.all();

console.log('=== EXTRACT FILE DATA DEBUG ===');
console.log('Input data keys:', Object.keys(webhookData[0]?.json || {}));

for (const item of webhookData) {
  console.log('Processing item body:', Object.keys(item.json?.body || {}));

  // Handle the new JSON structure with fileData in body
  if (item.json && item.json.body && item.json.body.fileData) {
    console.log('Found fileData in body');
    const body = item.json.body;

    const processedItem = {
      json: {
        fileName: body.fileName || 'uploaded.pdf',
        mimeType: 'application/pdf',
        fileSize: body.fileSize || 0,
        uploadTime: new Date().toISOString(),
        processId: Math.random().toString(36).substr(2, 9),
        inputType: 'body_fileData',
        conversionId: body.conversionId,
        userId: body.userId
      },
      binary: {
        data: {
          data: body.fileData,
          mimeType: 'application/pdf',
          fileName: body.fileName || 'uploaded.pdf',
          fileSize: body.fileSize || 0
        }
      }
    };

    console.log('Created processed item with fileData');
    items.push(processedItem);
  }
  // Handle old JSON structure with file
  else if (item.json && item.json.file) {
    console.log('Found JSON payload with file data');
    const processedItem = {
      json: {
        fileName: item.json.fileName || 'uploaded.pdf',
        mimeType: item.json.mimeType || 'application/pdf',
        fileSize: item.json.fileSize || 0,
        uploadTime: new Date().toISOString(),
        processId: Math.random().toString(36).substr(2, 9),
        inputType: 'json_base64'
      },
      binary: {
        data: {
          data: item.json.file,
          mimeType: item.json.mimeType || 'application/pdf',
          fileName: item.json.fileName || 'uploaded.pdf',
          fileSize: item.json.fileSize || 0
        }
      }
    };

    console.log('Created processed item with file');
    items.push(processedItem);
  }
  // Handle FormData uploads (fallback)
  else if (item.binary && item.binary.data) {
    console.log('Found binary data upload');
    items.push({
      json: {
        fileName: item.binary.data.fileName || 'uploaded.pdf',
        mimeType: item.binary.data.mimeType,
        fileSize: item.binary.data.fileSize,
        uploadTime: new Date().toISOString(),
        processId: Math.random().toString(36).substr(2, 9),
        inputType: 'form_data'
      },
      binary: {
        data: item.binary.data
      }
    });
  }
  else {
    console.log('No valid file data found in item');
    console.log('Available keys:', Object.keys(item.json || {}));
    items.push({
      json: {
        error: 'No file data found',
        inputType: 'unknown',
        availableKeys: Object.keys(item.json || {}),
        bodyKeys: Object.keys(item.json?.body || {})
      }
    });
  }
}

console.log('Extract File Data Output:', items.length, 'items');
return items;
